CREATE TABLE parameter_type (
	id INTEGER NOT NULL, 
	value VARCHAR(20) NOT NULL, 
	PRIMARY KEY (id), 
	UNIQUE (value)
);
CREATE TABLE stream (
	id INTEGER NOT NULL, 
	name VARCHAR(250) NOT NULL, 
	time_parameter INTEGER, 
	PRIMARY KEY (id), 
	UNIQUE (name)
);
CREATE TABLE stream_dependency (
	source_stream_id INTEGER NOT NULL, 
	product_stream_id INTEGER NOT NULL, 
	PRIMARY KEY (source_stream_id, product_stream_id), 
	FOREIGN KEY(source_stream_id) REFERENCES stream (id), 
	FOREIGN KEY(product_stream_id) REFERENCES stream (id)
);
CREATE TABLE stream_parameter (
	stream_id INTEGER NOT NULL, 
	parameter_id INTEGER NOT NULL, 
	PRIMARY KEY (stream_id, parameter_id), 
	FOREIGN KEY(stream_id) REFERENCES stream (id), 
	FOREIGN KEY(parameter_id) REFERENCES parameter (id)
);
CREATE TABLE unit (
	id INTEGER NOT NULL, 
	value VARCHAR(250) NOT NULL, 
	PRIMARY KEY (id), 
	UNIQUE (value)
);
CREATE TABLE value_encoding (
	id INTEGER NOT NULL, 
	value VARCHAR(20) NOT NULL, 
	PRIMARY KEY (id), 
	UNIQUE (value)
);
COMMIT;
