INSERT INTO "parameter" VALUES(833,'absolute_pressure_burst',3,1,NULL,16,1,'Absolute Pressure, psi',NULL,NULL,NULL,'SFLPRES_L0','The OOI Level 0 Seafloor Pressure core data product, which is created by either polling the SBE-26plus (PRESF) family of instruments (in real-time mode) for ASCII text formated psia (absolute pressure) data, or (post-recovery) by converting raw hexadecimal absolute pressure data into decimal format. Absolute pressure is the combined atmospheric and water column pressure. Note, the L1 SFLPRES data product in dbar is computed from the L0 by applying a scaling factor.');
