INSERT INTO "parameter" VALUES(848,'bottom_pressure',1,1,NULL,53,1,'Nano-resolution Bottom Pressure, psia',NULL,NULL,NULL,'BOTPRES_L1','The OOI Level 1 Nano-resolution Bottom Pressure (BOTPRES) core data product is produced by the BOTPT instrument class. The data for this core data product is derived directly from the output of an onboard Paroscientific Digiquartz Pressure Transducer (Model 42.4K-265) enabled for nanoresolution pressure measurements through pairing with a Paroscientific Intelligent Interface Board.');
