INSERT INTO "parameter" VALUES(1135,'seafloor_tilt_direction',5,1,NULL,15,1,'Seafloor Tilt Direction, degrees',0,73,X'7B22785F74696C74223A20225044383339222C202263636D70223A2022504431313333222C2022795F74696C74223A20225044383430227D','BOTTILT-TDIR_L1','The OOI Level 1 Seafloor High-Resolution Tilt (BOTTILT) core data product is produced by the BOTPT instrument class. The Tilt Direction (TDIR) component of BOTTILT is the corrected direction (in degrees, clockwise from North) of the seafloor downward tilt since the last re-leveling of the sensor.');
