INSERT INTO "parameter" VALUES(1157,'ensemble_start_time_2',1,2,NULL,7,1,'Ensemble Start Time, UTC',6,NULL,NULL,NULL,'Ensemble start time in seconds since Jan 01, 1900.');
INSERT INTO "parameter" VALUES(1158,'real_time_clock_2',3,9,NULL,3,5,'Real Time Clock Array',0,NULL,NULL,NULL,'Elements of the real-time clock array are: Year, Month, Day, Hour, Minute, Seconds, Hundredths. Units are standard time units, applied to each element respectively (year, month, day, hour, minutes, seconds, cseconds).');
INSERT INTO "parameter" VALUES(1159,'bottom_track_id',1,10,NULL,3,2,'Bottom Track (BT) ID',0,NULL,NULL,NULL,'Bottom Track packet ID ("00 06h")');
INSERT INTO "parameter" VALUES(1160,'bt_pings_per_ensemble',1,10,NULL,3,2,'BT Pings per Ensemble',0,NULL,NULL,NULL,'Stores the number of bottom-track pings to average together in each ensemble (BP-command). If BP = 0, the ADCP does not collect bottom-track data. The ADCP automatically ex-tends the ensemble interval (TE) if BP x TP > TE. Scaling: LSD = 1 ping; Range = 0 to 999 pings');
INSERT INTO "parameter" VALUES(1161,'bt_delay_before_reacquire',1,10,NULL,3,2,'BT Delay before Reacquire',0,NULL,NULL,NULL,'Stores the number of ADCP ensembles to wait after losing the bottom before trying to reacquire it (BD-command). Scaling: LSD = 1 ensemble; Range = 0 to 999 ensembles');
INSERT INTO "parameter" VALUES(1162,'bt_corr_magnitude_min',1,11,NULL,10,2,'BT Minimum Correlation Magnitude, counts',0,NULL,NULL,NULL,'Stores the minimum correlation magnitude value (BC-command). Scaling: LSD = 1 count; Range = 0 to 255 counts');
INSERT INTO "parameter" VALUES(1163,'bt_eval_magnitude_min',1,11,NULL,10,2,'BT Minimum Evaluation Amplitude, counts',0,NULL,NULL,NULL,'Stores the minimum evaluation amplitude value (BA-command). Scaling: LSD = 1 count; Range = 1 to 255 counts');
INSERT INTO "parameter" VALUES(1164,'bt_percent_good_min',1,11,NULL,43,2,'BT Minimum Percent Good, percent',0,NULL,NULL,NULL,'Stores the minimum percentage of bottom-track pings in an ensemble that must be good to output velocity data (BG-command).');
INSERT INTO "parameter" VALUES(1165,'bt_mode',1,11,NULL,3,2,'BT Mode',0,NULL,NULL,NULL,'Stores the bottom-tracking mode (BM-command). When the Lowered ADCP mode is set (WM15) the Bottom-Track mode will show up as Mode 11 (BM11). When the system uses standard Bottom-Track (BT-RA, see OL command), the Bottom-Track mode will show up as Mode 50 (BM50).');
INSERT INTO "parameter" VALUES(1166,'bt_error_velocity_max',1,10,NULL,39,2,'BT Maximum Error Velocity, mm s-1',0,NULL,NULL,NULL,'Stores the error velocity maximum value (BE-command). Scaling: LSD = 1 mm/s; Range = 0 to 5000 mm/s (0 = did not screen data)');
INSERT INTO "parameter" VALUES(1167,'bt_beam1_range',1,12,NULL,42,2,'BT Beam 1 Range, cm',0,NULL,NULL,NULL,'Contains the two lower bytes of the vertical range from the ADCP to the sea bottom (or surface) as determined by each beam. This vertical range does not consider the effects of pitch and roll. When bottom detections are bad, BT Range = 0. Scaling: LSD = 1 cm; Range = 0 to 65535 cm.');
INSERT INTO "parameter" VALUES(1168,'bt_beam2_range',1,12,NULL,42,2,'BT Beam 2 Range, cm',0,NULL,NULL,NULL,'Contains the two lower bytes of the vertical range from the ADCP to the sea bottom (or surface) as determined by each beam. This vertical range does not consider the effects of pitch and roll. When bottom detections are bad, BT Range = 0. Scaling: LSD = 1 cm; Range = 0 to 65535 cm.');
INSERT INTO "parameter" VALUES(1169,'bt_beam3_range',1,12,NULL,42,2,'BT Beam 3 Range, cm',0,NULL,NULL,NULL,'Contains the two lower bytes of the vertical range from the ADCP to the sea bottom (or surface) as determined by each beam. This vertical range does not consider the effects of pitch and roll. When bottom detections are bad, BT Range = 0. Scaling: LSD = 1 cm; Range = 0 to 65535 cm.');
INSERT INTO "parameter" VALUES(1170,'bt_beam4_range',1,12,NULL,42,2,'BT Beam 4 Range, cm',0,NULL,NULL,NULL,'Contains the two lower bytes of the vertical range from the ADCP to the sea bottom (or surface) as determined by each beam. This vertical range does not consider the effects of pitch and roll. When bottom detections are bad, BT Range = 0. Scaling: LSD = 1 cm; Range = 0 to 65535 cm.');
