INSERT INTO "parameter" VALUES(1183,'bt_beam1_percent_good',1,11,NULL,43,2,'BT Bottom Beam 1 Percent Good, percent',0,NULL,NULL,NULL,'Contains bottom-track percent-good data for each beam, which indicate the reliability of bottom-track data. It is the percentage of bottom-track pings that have passed the ADCPs bottom-track validity algorithm during an ensemble. Scaling: LSD = 1 percent; Range = 0 to 100 percent');
