INSERT INTO "parameter" VALUES(3068,'met_windavg_mag_corr_east',5,1,NULL,38,1,'Eastward Wind Velocity relative to True North',2,144,X'7B227A77696E647370223A202243435F6865696768745F6F665F77696E6473706565645F73656E736F725F61626F76655F7365616C6576656C5F6D222C20227575223A2022504431303539222C202274696D657374616D70223A2022504437222C20226C6F6E223A202243435F6C6F6E222C20227676223A2022504431303630222C20226C6174223A202243435F6C6174227D','WINDAVG-VLE_L1','WINDAVG-VLE_L1, the OOI Level 1 core data product for windspeed in the true eastward direction, for the METBK instrument by correcting for magnetic declination.');
INSERT INTO "parameter" VALUES(3069,'met_windavg_mag_corr_north',5,1,NULL,38,1,'Northward Wind Velocity relative to True North',2,145,X'7B227A77696E647370223A202243435F6865696768745F6F665F77696E6473706565645F73656E736F725F61626F76655F7365616C6576656C5F6D222C20227575223A2022504431303539222C202274696D657374616D70223A2022504437222C20226C6F6E223A202243435F6C6F6E222C20227676223A2022504431303630222C20226C6174223A202243435F6C6174227D','WINDAVG-VLN_L1','WINDAVG-VLN_L1, the OOI Level 1 core data product for windspeed in the true northward direction, for the METBK instrument by correcting for magnetic declination.');
INSERT INTO "parameter" VALUES(3070,'met_current_direction',5,1,NULL,15,1,'Current Direction, degrees',4,146,X'7B22766C655F7761746572223A2022504431313534222C2022766C6E5F7761746572223A2022504431313535227D','CURRENT_DIR','The direction of the surface current using the eastward and northward velocity components from the VELPT mounted on the surface buoy.');
INSERT INTO "parameter" VALUES(3071,'met_current_speed',5,1,NULL,38,1,'Current Speed, m/s',4,147,X'7B22766C655F7761746572223A2022504431313534222C2022766C6E5F7761746572223A2022504431313535227D','CURRENT_SPD','Estimated magnitude of the surface current using the eastward and northward velocity components from the VELPT mounted on the surface buoy. This is the meta-data "product" CURRENT specified by the DPS referenced below (Section 4.3, step 4). This product is not used in the METBK code; rather, the magnitude of the vector difference of te wind and current vectors is the fundamental variable used in the METBK calculations (see RELWIND_SPD-AUX). Because the direction of the current will also be calculated so as to be made available, the CURRENT metadata product is sub-divided into: CURRENT_SPD (calculated by this code) and CURRENT_DIR.');
INSERT INTO "parameter" VALUES(3072,'met_relwind_direction',5,1,NULL,15,1,'Relative Wind Direction, degrees',4,148,X'7B22766C6E5F77696E64223A2022504433303639222C2022766C655F7761746572223A2022504431313534222C2022766C655F77696E64223A2022504433303638222C2022766C6E5F7761746572223A2022504431313535227D','RELWIND_DIR-AUX','RELWIND_DIR-AUX, the direction of the vector difference of wind velocity (from METBK measurements) and surface current (from VELPT measurements). It is anticipated that the wind measurements will be roughly each minute and that the current measurements will be broadcast to that resolution.');
INSERT INTO "parameter" VALUES(3073,'met_relwind_speed',5,1,NULL,38,1,'Relative Wind Speed, m/s',4,149,X'7B22766C6E5F77696E64223A2022504433303639222C2022766C655F7761746572223A2022504431313534222C2022766C655F77696E64223A2022504433303638222C2022766C6E5F7761746572223A2022504431313535227D','RELWIND_SPD-AUX','RELWIND_SPD-AUX, the magnitude of the vector difference of surface current (from VELPT measurements) from wind velocity (from METBK measurements). This is the fundamental windspeed variable used in the METBK toga-coare algorithms. It is anticipated that the wind measurements will be roughly each minute and that the current measurements will be broadcast to that resolution.');
INSERT INTO "parameter" VALUES(3074,'met_timeflx',5,1,NULL,157,1,'Hourly Averaged Timestamp, seconds since 01-01-1900',4,150,X'7B2274696D657374616D70223A2022504437227D','TIMEFLX-AUX','TIMEFLX-AUX, the timestamps corresponding to the hourly averaged METBK data products. The units of the timestamps are seconds since 01-01-1900. The timestamp values are selected to be at the midpoint of the bin intervals, starting half an hour after the timestamp of the first data record to be processed. For example, if the first data record for 30 days of data is at 4:45 AM on a given day, the first timeflx stamp will be at 5:15 AM on that day, and all succeeding timestamps for the rest of the data will all be at 15 minutes past the hour.');
INSERT INTO "parameter" VALUES(3075,'met_netsirr',5,1,NULL,64,1,'Net Shortwave Radiation, W/m2',4,151,X'7B2273686F7274776176655F646F776E223A2022504431303538227D','NETSIRR_L2','NETSIRR_L2, the OOI core data product net shortwave radiation in the downward direction, for the METBK instrument.');
INSERT INTO "parameter" VALUES(3076,'met_rainrte',5,1,NULL,158,1,'Rain Rate, mm/hr',4,152,X'7B2274696D657374616D70223A2022504437222C202263756D756C61746976655F70726563697069746174696F6E223A2022504431303535227D','RAINRTE_L2','RAINRTE_L2, the OOI core data product rain rate, for the METBK instrument. The DPS requires that the output data be hourly; METBK is set up to give roughly one data record per minute for the data needed to calculate RAINRTE.');
INSERT INTO "parameter" VALUES(3077,'met_salsurf',5,1,NULL,3,1,'Sea Surface Practical Salinity, unitless',4,153,X'7B2274435F736561223A2022504431303536222C2022636F6E64223A2022504431303537222C20227A746D70776174223A202243435F64657074685F6F665F636F6E6475637469766974795F616E645F74656D70657261747572655F6D6561737572656D656E74735F6D227D','SALSURF_L2','OOI Level 2 Sea Surface Salinity core data product, which is calculated using the Thermodynamic Equations of Seawater - 2010 (TEOS-10) Version 3.0, with data from the conductivity, temperature and depth (CTD) family of instruments.');
INSERT INTO "parameter" VALUES(3078,'met_spechum',5,1,NULL,4,1,'Air Specific Humidity, g/kg',4,154,X'7B2274435F616972223A2022504431303533222C202270725F616972223A2022504431303531222C202272656C68756D223A2022504431303532227D','SPECHUM_L2','SPECHUM_L2, the OOI air specific humidity core data product, for the METBK instrument. Not to be confused with the SPHUM2M_L2 data product.');
INSERT INTO "parameter" VALUES(3079,'met_buoyfls',5,1,NULL,64,1,'Sonic Buoyancy Flux, W/m2',4,155,X'','BUOYFLS_L2','Calculated sonic buoyancy flux data product BUOYFLS_L2 using the sonic temperature instead of the virtual temperature. The FDCHP instrument calculates the analogous FLUXHOT_L2 data product also as a buoyancy flux using the sonic temperature. In contrast, the (METBK) data product BUOYFLX_L2 uses the virtual temperature in its calculation of buoyancy flux.');
INSERT INTO "parameter" VALUES(3080,'met_buoyflx',5,1,NULL,64,1,'Buoyancy Flux, W/m2',4,156,X'','BUOYFLX_L2','Calculated buoyancy flux data product BUOYFLX_L2 using the virtual temperature. This is the more fundamental quantity for buoyancy flux (rather than using the sonic temperature).');
INSERT INTO "parameter" VALUES(3081,'met_frshflx',5,1,NULL,158,1,'Freshwater Upward Flux, mm/hr',4,157,X'','FRSHFLX_L2','The freshwater upward flux data product FRSHFLX_L2.');
