INSERT INTO "parameter" VALUES(3084,'met_mommflx',5,1,NULL,159,1,'Wind Stress Tau (Absolute Value of the Momentum Flux), N/m2',4,160,X'','MOMMFLX_L2','The absolute value of the momentum flux MOMMFLX_L2, also called the wind stress tau.');
INSERT INTO "parameter" VALUES(3085,'met_netlirr',5,1,NULL,64,1,'Net Upward Longwave Irradiance, W/m2',4,161,X'','NETLIRR_L2','The net upward longwave irradiance NETLIRR_L2.');
