INSERT INTO "parameter" VALUES(3087,'met_sensflx',5,1,NULL,64,1,'Net Upward Sensible Heat Flux, W/m2',4,163,X'','SENSFLX_L2','The net upward sensible heat flux SENSFLX_L2.');
