INSERT INTO "parameter" VALUES(3716,'fdchp_a_tmpatur',5,1,NULL,6,1,'Sonic Temperature [degrees Celsius]',4,190,X'7B2274696D657374616D70223A202250464437222C2022736F6E696354223A2022504431303533227D','TMPATUR_L1','The L1 temperature data product TMPATUR_L1 from the FDCHP instrument, which collects 20 minutes of data every hour. The L1 data consists of these values less 30 seconds from both the beginning and end of each 12000 point dataset.');
