INSERT INTO "parameter" VALUES(3722,'fdchp_a_fluxmom_crosswind',5,1,NULL,183,1,'Cross-wind component of the momentum flux FLUXMOM-V_L2 [m^2/s^2]',4,196,X'','FLUXMOM-V_L2','FLUXMOM-V_L2, the cross-wind component of the momentum flux, from the FDCHP instrument, which collects 20 minutes of data every hour. There is one FLUXMOM-V_L2 value calculated for each 20 minute dataset of 12000 data records.');
INSERT INTO "parameter" VALUES(3723,'fdchp_a_time_L1',5,1,NULL,12,1,'Ttimestamps associated with the L1 data products [seconds since 1900-01-01]',4,197,X'7B2274696D657374616D70223A2022504437227D','TIME_L1-AUX','The time metadata product TIME_L1-AUX associated with the L1 wind and temperature data products from the FDCHP instrument, which collects 20 minutes of data every hour. For each of the L1 data products, 30 seconds of data is stripped out from the beginning and end of each 20 minute, 12000 record dataset. The TIME_L1-AUX values are the remaining timestamps for each dataset.');
INSERT INTO "parameter" VALUES(3724,'fdchp_a_time_L2',5,1,NULL,12,1,'Timestamps associated with the L2 data products [seconds since 1900-01-01]',4,198,X'7B2274696D657374616D70223A2022504437227D','TIME_L2-AUX','The time metadata product TIME_L2-AUX associated with the L2 flux data products from the FDCHP instrument. FDCHP collects 20 minutes of data every hour; for each of the L2 flux data products, one data value is calculated for each 20 minute dataset. The TIME_L2-AUX values are the median timestamps for each dataset.');
