INSERT INTO "parameter_function" VALUES(121,'vadcp_beam_eastward',3,'vadcp_beam_eastward','ion_functions.data.adcp_functions','Calculates the VELTURB-VLE_L1 data product (eastward seawater velocity) in m/s from the VADCP instrument.',NULL);
