INSERT INTO "parameter_function" VALUES(125,'vadcp_beam_error',3,'vadcp_beam_error','ion_functions.data.adcp_functions','Calculates the VELTURB-EVL_L1 data product (error velocity) in m/s from the VADCP instrument.',NULL);
INSERT INTO "parameter_function" VALUES(126,'adcp_beam2ins',3,'adcp_beam2ins','ion_functions.data.adcp_functions','This function converts the Beam Coordinate transformed velocity profiles to the instrument coordinate system. The calculations are defined in the Data Product Specification for Velocity Profile and Echo Intensity - DCN 1341-00750.',NULL);
INSERT INTO "parameter_function" VALUES(127,'adcp_ins2earth',3,'adcp_ins2earth','ion_functions.data.adcp_functions','This function converts the Instrument Coordinate transformed velocity profiles to the Earth coordinate system. The calculation is defined in the Data Product Specification for Velocity Profile and Echo Intensity - DCN 1341-00750.',NULL);
INSERT INTO "parameter_function" VALUES(128,'adcp_earth_upward',3,'adcp_earth_vertical','ion_functions.data.adcp_functions','Wrapper function to compute the Upward Velocity Profile (VELPROF-VLU) from Earth coordinate transformed velocity profiles as defined in the Data Product Specification for Velocity Profile and Echo Intensity - DCN 1341-00750.',NULL);
INSERT INTO "parameter_function" VALUES(129,'adcp_earth_error_velocity',3,'adcp_earth_error','ion_functions.data.adcp_functions','Wrapper function to compute the Error Velocity Profile (VELPROF-ERR) from Earth coordinate transformed velocity profiles as defined in the Data Product Specification for Velocity Profile and Echo Intensity - DCN 1341-00750.',NULL);
INSERT INTO "parameter_function" VALUES(130,'sfl_sflpres_rtime',3,'sfl_sflpres_rtime','ion_functions.data.sfl_functions','Scaling function to convert the absolute pressure measurement in psi to dbar. Used to compute SFLPRES-RTIME_L1.',NULL);
INSERT INTO "parameter_function" VALUES(131,'sfl_sflpres_tide',3,'sfl_sflpres_tide','ion_functions.data.sfl_functions','Used to compute SFLPRES-TIDE_L1.',NULL);
INSERT INTO "parameter_function" VALUES(132,'sfl_sflpres_wave',3,'sfl_sflpres_wave','ion_functions.data.sfl_functions','Used to compute SFLPRES-WAVE_L1.',NULL);
INSERT INTO "parameter_function" VALUES(133,'wav_triaxys_dir_freq',3,'wav_triaxys_dir_freq','ion_functions.data.wav_functions','Function to compute the WAVSTAT-FDS_L1 data product (frequency values for directional wave spectral bins) for the WAVSS instrument class (TRIAXYS Wave Sensor, manufactured by AXYS Technologies).',NULL);
INSERT INTO "parameter_function" VALUES(134,'wav_triaxys_nondir_freq',3,'wav_triaxys_nondir_freq','ion_functions.data.wav_functions','Function to compute the WAVSTAT-FND_L1 data product (frequency values for non-directional wave spectral bins) for the WAVSS instrument class (TRIAXYS Wave Sensor, manufactured by AXYS Technologies).',NULL);
INSERT INTO "parameter_function" VALUES(135,'wav_triaxys_buoymotion_time',3,'wav_triaxys_buoymotion_time','ion_functions.data.wav_functions','Function to compute the WAVSTAT-MOTT_L1 data product (time values associated with buoy displacement measurements WAVSTAT-MOT[X,Y,Z]) for the WAVSS instrument class (TRIAXYS Wave Sensor, manufactured by AXYS Technologies).',NULL);
INSERT INTO "parameter_function" VALUES(136,'wav_triaxys_correct_mean_wave_direction',3,'wav_triaxys_correct_mean_wave_direction','ion_functions.data.wav_functions','Function to compute the WAVSTAT-D_L2 data product (mean wave direction corrected for magnetic declination) for the WAVSS instrument class (TRIAXYS Wave Sensor, manufactured by AXYS Technologies).',NULL);
INSERT INTO "parameter_function" VALUES(137,'wav_triaxys_correct_directional_wave_direction',3,'wav_triaxys_correct_directional_wave_direction','ion_functions.data.wav_functions','Function to compute the WAVSTAT-DDS_L2 data product (directional wave directions corrected for magnetic declination) for the WAVSS instrument class (TRIAXYS Wave Sensor, manufactured by AXYS Technologies).',NULL);
INSERT INTO "parameter_function" VALUES(138,'wav_triaxys_magcor_buoymotion_x',3,'wav_triaxys_magcor_buoymotion_x','ion_functions.data.wav_functions','Function to compute the WAVSTAT-MOTX_L1 data product (eastward buoy displacement) for the WAVSS instrument class (TRIAXYS Wave Sensor, manufactured by AXYS Technologies) from the WAVSTAT-MOTX_L0 and WAVSTAT-MOTY_L0 data products. All that is required is to correct for magnetic declination (variation).',NULL);
INSERT INTO "parameter_function" VALUES(139,'wav_triaxys_magcor_buoymotion_y',3,'wav_triaxys_magcor_buoymotion_y','ion_functions.data.wav_functions','Function to compute the WAVSTAT-MOTY_L1 data product (northward buoy displacement) for the WAVSS instrument class (TRIAXYS Wave Sensor, manufactured by AXYS Technologies) from the WAVSTAT-MOTX_L0 and WAVSTAT-MOTY_L0 data products. All that is required is to correct for magnetic declination (variation).',NULL);
INSERT INTO "parameter_function" VALUES(140,'ctd_sbe37im_tempwat',3,'ctd_sbe37im_tempwat','ion_functions.data.ctd_functions',NULL,NULL);
INSERT INTO "parameter_function" VALUES(141,'ctd_sbe37im_condwat',3,'ctd_sbe37im_condwat','ion_functions.data.ctd_functions',NULL,NULL);
INSERT INTO "parameter_function" VALUES(142,'ctd_sbe37im_preswat',3,'ctd_sbe37im_preswat','ion_functions.data.ctd_functions',NULL,NULL);
INSERT INTO "parameter_function" VALUES(143,'BARPRES_L1',3,'met_barpres','ion_functions.data.met_functions','OOI Level 1 Barometric Pressure core data product, which is calculated by scaling the measured barometric pressure from mbar to Pascals.',NULL);
INSERT INTO "parameter_function" VALUES(144,'WINDAVG-VLE_L1',3,'met_windavg_mag_corr_east','ion_functions.data.met_functions','Calculates WINDAVG-VLE_L1, the OOI Level 1 core data product for windspeed in the true eastward direction, for the METBK instrument by correcting for magnetic declination.',NULL);
INSERT INTO "parameter_function" VALUES(145,'WINDAVG-VLN_L1',3,'met_windavg_mag_corr_north','ion_functions.data.met_functions','Calculates WINDAVG-VLN_L1, the OOI Level 1 core data product for windspeed in the true northward direction, for the METBK instrument by correcting for magnetic declination.',NULL);
INSERT INTO "parameter_function" VALUES(146,'CURRENT_DIR',3,'met_current_direction','ion_functions.data.met_functions','Calculates the direction of the surface current using the eastward and northward velocity components from the VELPT mounted on the surface buoy.',NULL);
INSERT INTO "parameter_function" VALUES(147,'CURRENT_SPD',3,'met_current_speed','ion_functions.data.met_functions','Estimate the magnitude of the surface current using the eastward and northward velocity components from the VELPT mounted on the surface buoy. This is the meta-data "product" CURRENT specified by the DPS referenced below (Section 4.3, step 4). This product is not used in the METBK code; rather, the magnitude of the vector difference of te wind and current vectors is the fundamental variable used in the METBK calculations (see RELWIND_SPD-AUX). Because the direction of the current will also be calculated so as to be made available, the CURRENT metadata product is sub-divided into: CURRENT_SPD (calculated by this code) and CURRENT_DIR.',NULL);
INSERT INTO "parameter_function" VALUES(148,'RELWIND_DIR-AUX',3,'met_relwind_direction','ion_functions.data.met_functions','Calculates RELWIND_DIR-AUX, the direction of the vector difference of wind velocity (from METBK measurements) and surface current (from VELPT measurements). It is anticipated that the wind measurements will be roughly each minute and that the current measurements will be broadcast to that resolution.',NULL);
INSERT INTO "parameter_function" VALUES(149,'RELWIND_SPD-AUX',3,'met_relwind_speed','ion_functions.data.met_functions','Calculates RELWIND_SPD-AUX, the magnitude of the vector difference of surface current (from VELPT measurements) from wind velocity (from METBK measurements). This is the fundamental windspeed variable used in the METBK toga-coare algorithms. It is anticipated that the wind measurements will be roughly each minute and that the current measurements will be broadcast to that resolution.',NULL);
INSERT INTO "parameter_function" VALUES(150,'TIMEFLX-AUX',3,'met_timeflx','ion_functions.data.met_functions','Calculates TIMEFLX-AUX, the timestamps corresponding to the hourly averaged METBK data products. The units of the timestamps are seconds since 01-01-1900. The timestamp values are selected to be at the midpoint of the bin intervals, starting half an hour after the timestamp of the first data record to be processed. For example, if the first data record for 30 days of data is at 4:45 AM on a given day, the first timeflx stamp will be at 5:15 AM on that day, and all succeeding timestamps for the rest of the data will all be at 15 minutes past the hour.',NULL);
INSERT INTO "parameter_function" VALUES(151,'NETSIRR_L2',3,'met_netsirr','ion_functions.data.met_functions','Calculates NETSIRR_L2, the OOI core data product net shortwave radiation in the downward direction, for the METBK instrument. This data product may have been misclassified (it looks like L1).',NULL);
INSERT INTO "parameter_function" VALUES(152,'RAINRTE_L2',3,'met_rainrte','ion_functions.data.met_functions','Calculates RAINRTE_L2 (probably really an L1 product), the OOI core data product rain rate, for the METBK instrument. The DPS requires that the output data be hourly; METBK is set up to give roughly one data record per minute for the data needed to calculate RAINRTE.',NULL);
INSERT INTO "parameter_function" VALUES(153,'SALSURF_L2',3,'met_salsurf','ion_functions.data.met_functions','OOI Level 2 Sea Surface Salinity core data product, which is calculated using the Thermodynamic Equations of Seawater - 2010 (TEOS-10) Version 3.0, with data from the conductivity, temperature and depth (CTD) family of instruments.',NULL);
INSERT INTO "parameter_function" VALUES(154,'SPECHUM_L2',3,'met_spechum','ion_functions.data.met_functions','Calculates SPECHUM_L2, the OOI air specific humidity core data product, for the METBK instrument. Not to be confused with the SPHUM2M_L2 data product.',NULL);
INSERT INTO "parameter_function" VALUES(155,'BUOYFLS_L2',3,'met_buoyfls','ion_functions.data.met_functions','Calculates the sonic buoyancy flux (proposed) data product BUOYFLS_L2 using the sonic temperature instead of the virtual temperature. The FDCHP instrument calculates the analogous FLUXHOT_L2 data product also as a buoyancy flux using the sonic temperature. In contrast, the (METBK) proposed data product BUOYFLX_L2 uses the virtual temperature in its calculation of buoyancy flux.',NULL);
INSERT INTO "parameter_function" VALUES(156,'BUOYFLX_L2',3,'met_buoyflx','ion_functions.data.met_functions','Calculates the buoyancy flux (proposed) data product BUOYFLX_L2 using the virtual temperature. This is the more fundamental quantity for buoyancy flux (rather than using the sonic temperature).',NULL);
INSERT INTO "parameter_function" VALUES(157,'FRSHFLX_L2',3,'met_frshflx','ion_functions.data.met_functions','Calculates the freshwater upward flux data product FRSHFLX_L2.',NULL);
INSERT INTO "parameter_function" VALUES(158,'HEATFLX_L2',3,'met_heatflx','ion_functions.data.met_functions','Calculates the total net upward heat flux data product HEATFLX_L2.',NULL);
INSERT INTO "parameter_function" VALUES(159,'LATNFLX_L2',3,'met_latnflx','ion_functions.data.met_functions','Calculates the upward latent heat flux data product LATNFLX_L2.',NULL);
INSERT INTO "parameter_function" VALUES(160,'MOMMFLX_L2',3,'met_mommflx','ion_functions.data.met_functions','Calculates (the absolute value of) the momentum flux MOMMFLX_L2, also called the wind stress tau.',NULL);
INSERT INTO "parameter_function" VALUES(161,'NETLIRR_L2',3,'met_netlirr','ion_functions.data.met_functions','Calculates the net upward longwave irradiance NETLIRR_L2.',NULL);
INSERT INTO "parameter_function" VALUES(162,'RAINFLX_L2',3,'met_rainflx','ion_functions.data.met_functions','Calculates the net upward rain heat flux RAINFLX_L2. A new derivation for rain heat flux is used, as calculated in the subroutine rain_heat_flux.',NULL);
INSERT INTO "parameter_function" VALUES(163,'SENSFLX_L2',3,'met_sensflx','ion_functions.data.met_functions','Calculates the net upward sensible heat flux SENSFLX_L2.',NULL);
INSERT INTO "parameter_function" VALUES(164,'SPHUM2M_L2',3,'met_sphum2m','ion_functions.data.met_functions','Calculates the modelled specific humidity at a reference height of 2m SPHUM2M_L2.',NULL);
INSERT INTO "parameter_function" VALUES(165,'STABLTY_L2',3,'met_stablty','ion_functions.data.met_functions','Calculates the Monin-Obukhov stability parameter metadata product STABLTY_L2.',NULL);
INSERT INTO "parameter_function" VALUES(166,'TEMPA2M_L2',3,'met_tempa2m','ion_functions.data.met_functions','Calculates the modelled air temperature at a reference height of 2m TEMPA2M_L2.',NULL);
INSERT INTO "parameter_function" VALUES(167,'TEMPSKN_L2',3,'met_tempskn','ion_functions.data.met_functions','Calculates the skin sea temperature based on the warmlayer and coolskin (coare35vn) model: metadata product TEMPSKN_L2.',NULL);
INSERT INTO "parameter_function" VALUES(168,'WIND10M_L2',3,'met_wind10m','ion_functions.data.met_functions','Calculates the modelled windspeed at a reference height of 10m WIND10M_L2.',NULL);
INSERT INTO "parameter_function" VALUES(169,'VELPTMN-VLE_L1',3,'vel3dk_east','ion_functions.data.vel_functions','Function to compute the Eastward Velocity L1 VELPTMN-VLE in True Earth coordinates',NULL);
INSERT INTO "parameter_function" VALUES(170,'VELPTMN-VLN_L1',3,'vel3dk_north','ion_functions.data.vel_functions','Function to compute the Northward Velocity L1 VELPTMN-VLN in True Earth coordinates',NULL);
INSERT INTO "parameter_function" VALUES(171,'VELPTMN-VLU_L1',3,'vel3dk_up','ion_functions.data.vel_functions','Function to compute the Upward Velocity L1 VELPTMN-VLU',NULL);
INSERT INTO "parameter_function" VALUES(172,'opt_par_wetlabs',3,'opt_par_wetlabs','ion_functions.data.opt_functions','Calculates the L1 OPTPARW from Wet Labs PAR instruments.',NULL);
INSERT INTO "parameter_function" VALUES(173,'fsi_acm_rsn_east',3,'fsi_acm_rsn_east','ion_functions.data.vel_functions','Calculates the VEL3D Series A eastwards velocity data product VELPTMN-VLE_L1 for the Falmouth Scientific (FSI) Acoustic Current Meter (ACM) mounted on a McLane profiler as deployed by RSN. The horizontal velocities are corrected for magnetic declination.',NULL);
INSERT INTO "parameter_function" VALUES(174,'fsi_acm_rsn_north',3,'fsi_acm_rsn_north','ion_functions.data.vel_functions','Calculates the VEL3D Series A northwards velocity data product VELPTMN-VLN_L1 for the Falmouth Scientific (FSI) Acoustic Current Meter (ACM) mounted on a McLane profiler as deployed by RSN. The horizontal velocities are corrected for magnetic declination.',NULL);
INSERT INTO "parameter_function" VALUES(175,'fsi_acm_sio_east',3,'fsi_acm_sio_east','ion_functions.data.vel_functions','Calculates the VEL3D Series L eastwards velocity data product VELPTMN-VLE_L1 for the Falmouth Scientific (FSI) Acoustic Current Meter (ACM) mounted on a McLane profiler as deployed by Scripps. Horizontal velocities are corrected for magnetic variation.',NULL);
INSERT INTO "parameter_function" VALUES(176,'fsi_acm_sio_north',3,'fsi_acm_sio_north','ion_functions.data.vel_functions','Calculates the VEL3D Series L northwards velocity data product VELPTMN-VLN_L1 for the Falmouth Scientific (FSI) Acoustic Current Meter (ACM) mounted on a McLane profiler as deployed by Scripps. Horizontal velocities are corrected for magnetic variation.',NULL);
INSERT INTO "parameter_function" VALUES(177,'fsi_acm_up_profiler_ascending',3,'fsi_acm_up_profiler_ascending','ion_functions.data.vel_functions','Calculates the VEL3D Series A and L upward velocity data product VELPTMN-VLU-ASC_L1 for the Falmouth Scientific (FSI) Acoustic Current Meter (ACM) mounted on a McLane profiler.',NULL);
INSERT INTO "parameter_function" VALUES(178,'fsi_acm_up_profiler_descending',3,'fsi_acm_up_profiler_descending','ion_functions.data.vel_functions','Calculates the VEL3D Series A and L upwards velocity data product VELPTMN-VLU-DSC_L1 for the Falmouth Scientific (FSI) Acoustic Current Meter (ACM) mounted on a McLane profiler.',NULL);
INSERT INTO "parameter_function" VALUES(179,'prs_botsflu_time15s',3,'prs_botsflu_time15s','ion_functions.data.prs_functions','Calculates the auxiliary BOTSFLU data product TIME15S-AUX. These are timestamps anchored at multiples of 15 seconds past the minute which correspond to the time base for the BOTSFLU data products which are binned on 15 seconds.',NULL);
INSERT INTO "parameter_function" VALUES(180,'prs_botsflu_meanpres',3,'prs_botsflu_meanpres','ion_functions.data.prs_functions','Calculates the BOTSFLU data product MEANPRES_L1.',NULL);
INSERT INTO "parameter_function" VALUES(181,'prs_botsflu_meandepth',3,'prs_botsflu_meandepth','ion_functions.data.prs_functions','Calculates the BOTSFLU data product MEANDEPTH_L2, de-tided bottom depth as a function of time (15sec bins).',NULL);
INSERT INTO "parameter_function" VALUES(182,'prs_botsflu_5minrate',3,'prs_botsflu_5minrate','ion_functions.data.prs_functions','Calculates the BOTSFLU data product 5MINRATE_L2, the instantaneous rate of depth change using 5 minute backwards-looking meandepth data.',NULL);
INSERT INTO "parameter_function" VALUES(183,'prs_botsflu_10minrate',3,'prs_botsflu_10minrate','ion_functions.data.prs_functions','Calculates the BOTSFLU data product 10MINRATE_L2, the mean seafloor uplift rate calculated using 10 minute backwards-looking 10 minute running mean depth data.',NULL);
INSERT INTO "parameter_function" VALUES(184,'prs_botsflu_time24h',3,'prs_botsflu_time24h','ion_functions.data.prs_functions','Calculates the auxiliary BOTSFLU data product TIME24H-AUX. These are timestamps anchored at midnight which correspond to the time base for the BOTSFLU data products which are binned on a day''s worth of data.',NULL);
INSERT INTO "parameter_function" VALUES(185,'prs_botsflu_daydepth',3,'prs_botsflu_daydepth','ion_functions.data.prs_functions','Calculates the BOTSFLU data product DAYDEPTH_L2, de-tided bottom depth as a function of time (1 day bins).',NULL);
INSERT INTO "parameter_function" VALUES(186,'prs_botsflu_4wkrate',3,'prs_botsflu_4wkrate','ion_functions.data.prs_functions','Calculates the BOTSFLU data product 4WKRATE_L2, the mean rate of seafloor change as calculated by 4-week backwards-looking linear regressions.',NULL);
INSERT INTO "parameter_function" VALUES(187,'prs_botsflu_8wkrate',3,'prs_botsflu_8wkrate','ion_functions.data.prs_functions','Calculates the BOTSFLU data product 8WKRATE_L2, the mean rate of seafloor change as calculated by 8-week backwards-looking linear regressions.',NULL);
INSERT INTO "parameter_function" VALUES(188,'prs_botsflu_predtide',3,'prs_botsflu_predtide','ion_functions.data.prs_functions','Assigns tide values for the 3 BOTPT instrument sites about 500 km west of Astoria. When the input argument is the data product TIME15S, the output of this function will be the BOTSFLU data product BOTSFLU-PREDTIDE_L2.',NULL);
INSERT INTO "parameter_function" VALUES(189,'scale_it',1,'value*scaler',NULL,'Scale the value.',NULL);
INSERT INTO "parameter_function" VALUES(190,'fdc_tmpatur',3,'fdc_tmpatur','ion_functions.data.fdc_functions','Calculates the L1 temperature data product TMPATUR_L1 from the FDCHP instrument, which collects 20 minutes of data every hour. The L1 data consists of these values less 30 seconds from both the beginning and end of each 12000 point dataset.',NULL);
INSERT INTO "parameter_function" VALUES(191,'fdc_windtur_north',3,'fdc_windtur_north','ion_functions.data.fdc_functions','Calculates the L1 windspeed data product WINDTUR-VLN_L1 from the FDCHP instrument, which collects 20 minutes of data every hour. The L1 data consists of these values less 30 seconds from both the beginning and end of each 12000 point dataset.',NULL);
INSERT INTO "parameter_function" VALUES(192,'fdc_windtur_up',3,'fdc_windtur_up','ion_functions.data.fdc_functions','Calculates the L1 windspeed data product WINDTUR-VLU_L1 from the FDCHP instrument, which collects 20 minutes of data every hour. The L1 data consists of these values less 30 seconds from both the beginning and end of each 12000 point dataset.',NULL);
INSERT INTO "parameter_function" VALUES(193,'fdc_windtur_west',3,'fdc_windtur_west','ion_functions.data.fdc_functions','Calculates the L1 windspeed data product WINDTUR-VLW_L1 from the FDCHP instrument, which collects 20 minutes of data every hour. The L1 data consists of these values less 30 seconds from both the beginning and end of each 12000 point dataset.',NULL);
INSERT INTO "parameter_function" VALUES(194,'fdc_fluxhot',3,'fdc_fluxhot','ion_functions.data.fdc_functions','Calculates FLUXHOT_L2, the sonic buoyancy flux, from the FDCHP instrument, which collects 20 minutes of data every hour. There is one FLUXHOT value calculated for each 20 minute dataset of 12000 data records.',NULL);
INSERT INTO "parameter_function" VALUES(195,'fdc_fluxmom_alongwind',3,'fdc_fluxmom_alongwind','ion_functions.data.fdc_functions','Calculates FLUXMOM-U_L2, the along-wind component of the momentum flux, from the FDCHP instrument, which collects 20 minutes of data every hour. There is one FLUXMOM-U_L2 value calculated for each 20 minute dataset of 12000 data records.',NULL);
INSERT INTO "parameter_function" VALUES(196,'fdc_fluxmom_crosswind',3,'fdc_fluxmom_crosswind','ion_functions.data.fdc_functions','Calculates FLUXMOM-V_L2, the cross-wind component of the momentum flux, from the FDCHP instrument, which collects 20 minutes of data every hour. There is one FLUXMOM-V_L2 value calculated for each 20 minute dataset of 12000 data records.',NULL);
INSERT INTO "parameter_function" VALUES(197,'fdc_time_L1',3,'fdc_time_L1','ion_functions.data.fdc_functions','Calculates the time metadata product TIME_L1-AUX associated with the L1 wind and temperature data products from the FDCHP instrument, which collects 20 minutes of data every hour. For each of the L1 data products, 30 seconds of data is stripped out from the beginning and end of each 20 minute, 12000 record dataset. The TIME_L1-AUX values are the remaining timestamps for each dataset.',NULL);
INSERT INTO "parameter_function" VALUES(198,'fdc_time_L2',3,'fdc_time_L2','ion_functions.data.fdc_functions','Calculates the time metadata product TIME_L2-AUX associated with the L2 flux data products from the FDCHP instrument. FDCHP collects 20 minutes of data every hour; for each of the L2 flux data products, one data value is calculated for each 20 minute dataset. The TIME_L2-AUX values are the median timestamps for each dataset.',NULL);
